  `Codigo_Produccion` int(11) default NULL,
  `Codigo_Perdidas` int(11) default NULL,
  `Codigo_Ventas` int(11) default NULL,
  `Fecha` date default NULL,
  PRIMARY KEY  (`Codigo`),
  KEY `Codigo_Block_idx` (`Codigo_Block`),
  KEY `Codigo_ventas_idx` (`Codigo_Ventas`),
  KEY `Codigo_Produccion_idx` (`Codigo_Produccion`),
  KEY `Codigo_Perdidas_idx` (`Codigo_Perdidas`),
  CONSTRAINT `Codigo_Block` FOREIGN KEY (`Codigo_Block`) REFERENCES `block` (`Codigo`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Codigo_Perdidas` FOREIGN KEY (`Codigo_Perdidas`) REFERENCES `perdida_block` (`Codigo`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Codigo_Produccion` FOREIGN KEY (`Codigo_Produccion`) REFERENCES `produccion` (`Codigo`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Codigo_ventas` FOREIGN KEY (`Codigo_Ventas`) REFERENCES `venta` (`Codigo`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

